import React from "react";
import "./card.css";
class CardRow extends React.Component {
  constructor(props) {
    super();
    this.state = {
      isActive: false
    };
  }
  toggleModal = () => {};
  render() {
    return (
      <div className="card">
        <img src={this.props.track.image[2]["#text"]} alt="" />
        <h4 onClick={this.toggleModal}>{this.props.track.name}</h4>

        <p onClick={this.toggleModal}>{this.props.track.artist.name}</p>
      </div>
    );
  }
}

export default CardRow;
